function login() {
  var name = document.getElementById("name_input");
  var password = document.getElementById("password_input");
  if (name.value.trim() == null || name.value.trim() == "") {
    if (name.value.length < 1) {
      var output = (document.getElementById("output").innerHTML =
        "error! name isn't blank or less than 1!");
        document.getElementById("name_input").style.border='2px solid red'
        document.getElementById("password_input").style.border='2px solid red'
        return false;
    }
  } else if (password.value == null || password.value == "") {
    if (password.value.length < 6) {
      document.getElementById("output").innerHTML =
        "error! password isn't blank or less than 6!";
        document.getElementById("password_input").style.border='2px solid red'
        document.getElementById("name_input").style.border='2px solid #0DB8DE';
        document.getElementById("name_input").style.boxShadow="";
        return false;
    }
  } else {
    alert("you have succesfully logged in")
      document.querySelector(".login").style.display='none'
    document.querySelector(".instagram").style.display="block"
    return true;
  }
}

