function showChats(data) {
  var chatsBox = document.getElementById("chats_page");
  for (var i = 0; i < data.length; i++) {
    var chat = data[i];

    var output2 = `<div id="chats">
                        <img src=${chat.img} id="chat_image">            
                     <div id="texts">
                     <p id="chat_names">${chat.name2}</p>
                     <p id="chat_messages">${chat.message}</p>
                     </div>
                    </div>
                      `;
    chatsBox.innerHTML += output2;
  }
}
